import React from "react";
import ReactDOM from 'react-dom';


const App = () => {
    return <h1>This is heading tag</h1>
}


const App1 = () => {
    return <p>This is paragraph</p>
}


ReactDOM.render([<App />,<App1 />], document.getElementById('root'));
